import './App.css';
import Navbar from './components/Navbar';
import WeatherApp from './WeatherApp';

function App(isReload) {

  const handleLogoClick = () => {
    isReload = true;
  };

  return (
    <div className="App bg-default h-screen">
      <header className="App-header sticky top-0 max-w-full mx-auto z-99 xl:items-center">
        <Navbar handleLogoClick={handleLogoClick} />
      </header>

      <div className='p-2'>
        <WeatherApp />
      </div>
    </div>
  );
}

export default App;
